import React, { Component } from 'react';
import { Button, List } from 'semantic-ui-react';

class App extends Component {

    render() {
        return (
            <div style={
                {
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    height: '100vh'
                }
            }>
                <div>
                    <link rel="stylesheet" href="//cdn.jsdelivr.net/npm/semantic-ui@2.4.2/dist/semantic.min.css" />
                    <List>
                        <List.Item><div style={{
                            width: 300, alignItems: 'center',
                            display: 'flex',
                            justifyContent: 'center'
                        }}>
                            <h2>Edu-Ledger</h2>
                        </div>
                        </List.Item>
                        <List.Item><Button primary style={{ width: 300 }}>Student</Button></List.Item>
                        <List.Item><Button primary style={{ width: 300 }}>College</Button></List.Item>
                        <List.Item><Button primary style={{ width: 300 }}>Bank</Button></List.Item>
                        <List.Item></List.Item>
                        <List.Item></List.Item>
                        <List.Item><h3>MetaMask Address:</h3></List.Item>
                    </List>
                </div>
            </div>
        )
    };
}

export default App;
